import React from 'react'

export default function ListItems({listItems}) {
    const bucketList = () => {
        let h= [];
        listItems.map((item,index)=>{
                h.push(<li key={index}> {item.title}</li>
              )
            })
            return h; 
    }
    return (
    listItems ? <ul className="list-unstyled">
          {bucketList()}
    </ul> : null
    )
}
